// src/Components/settings/Profile.js
import React, { useState } from "react";
import { supabase } from "../../Supabase/supabaseClient";
import { useNavigate } from "react-router-dom";
import "../../Style/Admin.css";

function Profile({ adminUser }) {
  const [form, setForm] = useState({
    username: adminUser?.username || "",
    password: adminUser?.password || "",
    email: adminUser?.email || "",
    phone_number: adminUser?.phone_number || ""
  });
  const [otpSent, setOtpSent] = useState(false);
  const [otp, setOtp] = useState("");
  const [message, setMessage] = useState("");
  const navigate = useNavigate();

  // ✅ Send OTP to email
  const sendOTP = async () => {
    if (!form.email) {
      setMessage("❌ Please enter an email.");
      return;
    }
    const { error } = await supabase.auth.signInWithOtp({ email: form.email });
    if (error) {
      setMessage("❌ Failed to send OTP: " + error.message);
    } else {
      setMessage("📩 OTP sent to " + form.email);
      setOtpSent(true);
    }
  };

  // ✅ Save profile (after OTP)
  const handleSave = async () => {
    if (!otpSent || !otp) {
      setMessage("❌ Please verify your email with OTP before saving.");
      return;
    }

    // ⚠️ In real app: verify OTP via Supabase's magic link or server function

    const { error } = await supabase
      .from("admin")
      .update({
        username: form.username,
        password: form.password,
        email: form.email,
        phone_number: form.phone_number
      })
      .eq("id", adminUser.id);

    if (error) {
      setMessage("❌ Update failed: " + error.message);
    } else {
      setMessage("✅ Profile updated. Use new credentials next login!");
    }
  };

  return (
    <div className="page-container">
      <button className="btn" onClick={() => navigate(-1)}>⬅ Back</button>
      <h2>👤 Admin Profile</h2>

      <div className="card">
        <div className="form-group">
          <label>Username</label>
          <input type="text" value={form.username}
            onChange={(e) => setForm({ ...form, username: e.target.value })} />
        </div>
        <div className="form-group">
          <label>Password</label>
          <input type="password" value={form.password}
            onChange={(e) => setForm({ ...form, password: e.target.value })} />
        </div>
        <div className="form-group">
          <label>Email</label>
          <input type="email" value={form.email}
            onChange={(e) => setForm({ ...form, email: e.target.value })} />
        </div>
        <div className="form-group">
          <label>Phone</label>
          <input type="text" value={form.phone_number}
            onChange={(e) => setForm({ ...form, phone_number: e.target.value })} />
        </div>

        {!otpSent ? (
          <button className="btn primary" onClick={sendOTP}>Send OTP</button>
        ) : (
          <>
            <div className="form-group">
              <label>Enter OTP</label>
              <input type="text" value={otp}
                onChange={(e) => setOtp(e.target.value)} placeholder="Check your email" />
            </div>
            <button className="btn primary" onClick={handleSave}>Save Profile</button>
          </>
        )}
      </div>

      {message && <p className="message">{message}</p>}
    </div>
  );
}

export default Profile;
